Energy_Intensity_Var_1.query:
q = load "${App.Datasets.Demo_Building_Energy_Intensity_tp.FullyQualifiedName}";
q = filter q by 'IsUnitedStatesBuilding' == "Yes";
q = group q by 'Asset';
q = foreach q generate 'Asset' as 'Asset', sum('CarbonEmission') as 'CarbonEmission', avg('EnergyIntensityVariance') as 'EnergyIntensityVariance';
q = order q by 'Asset' asc;
q = limit q 2000;

