Total_Carbon_Emissio_1.query:
q = load "${App.Datasets.Demo_Building_Energy_Intensity_tp.FullyQualifiedName}";
q_A = filter q by {{row(ReportingDate_1.selection, [0], ["min", "max"]).asDateRange("date('ReportPeriod_Year', 'ReportPeriod_Month', 'ReportPeriod_Day')")}};
q_B = filter q by {{row(ReportingDate_2.selection, [0], ["min", "max"]).asDateRange("date('ReportPeriod_Year', 'ReportPeriod_Month', 'ReportPeriod_Day')")}};
result = group q_A by all full, q_B by all;
result = foreach result generate sum(q_A.'CarbonEmission') as 'CarbonEmission_Present',sum(q_B.'CarbonEmission') as 'CarbonEmission_Past', sum(q_A.'EnergyIntensity') as 'Energy_Consumption_Present', sum(q_B.'EnergyIntensity') as 'Energy_Consumption_Past';
result = foreach result generate 'CarbonEmission_Present', 'CarbonEmission_Past', 'Energy_Consumption_Present', 'Energy_Consumption_Past', (CarbonEmission_Present - CarbonEmission_Past)/ CarbonEmission_Past as 'Total_Carbon_Emission_Percentage',  (Energy_Consumption_Present - Energy_Consumption_Past)/ Energy_Consumption_Past as 'Energy_Consumption_Percentage';
result = limit result 2000;

Electricity_Intensit_2.query:
q = load "${App.Datasets.Demo_Building_Energy_Intensity_tp.FullyQualifiedName}";
q = filter q by 'IsUnitedStatesBuilding' == "Yes";
result = group q by 'Asset';
result = foreach result generate q.'Asset' as 'Asset', coalesce(sum(q.'EnergyIntensity'), 0) as 'EnergyIntensity', sum(q.'CarbonEmission') as 'CarbonEmission';
result = order result by ('Asset' asc);
result = limit result 2000;

Electricity_Intensit_1.query:
q = load "${App.Datasets.Demo_Building_Energy_Intensity_tp.FullyQualifiedName}";
q = filter q by 'IsUnitedStatesBuilding' != "Yes";
q_A = filter q by {{row(ReportingDate_1.selection, [0], ["min", "max"]).asDateRange("date('ReportPeriod_Year', 'ReportPeriod_Month', 'ReportPeriod_Day')")}};
q_B = filter q by {{row(ReportingDate_2.selection, [0], ["min", "max"]).asDateRange("date('ReportPeriod_Year', 'ReportPeriod_Month', 'ReportPeriod_Day')")}};
result = group q_A by 'Asset' full, q_B by 'Asset';
result = foreach result generate coalesce(q_A.'Asset', q_B.'Asset') as 'Asset', sum(q_A.'EnergyIntensity') as 'Emission_Consumption_Intensity_SelectedDuration', sum(q_B.'EnergyIntensity') as 'Emission_Consumption_Intensity_ComparitiveDuration';
result = order result by (('Emission_Consumption_Intensity_SelectedDuration') desc nulls last);
result = limit result 2000;
